import paper from './paper.jpg';
import L1 from './LonardoA01.jpg';
import L2 from './LonardoA02.jpg';
import L3 from './LonardoA03.jpg';
import L4 from './LonardoA04.jpg';
import styled from 'styled-components'


const Background = styled.div`
    background-image: url("${L1}");
    background-size: 100% ;
    padding: 10px;
    
`;


export default Background
